import React from 'react';
import Slider from 'react-slick'

import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import { Link  } from 'react-router-dom';

const Sanphamnoibat = () => {
    const settings =  {
      arrowsScroll: 2,
      autoplay: true,
      initialSlide: true,
      rows: 2,
      slidesToShow: 5,
      swipe: false,
    };
    const slidesData02 = [
    {
        id: 1,
        text: 'text',

    },
    {
        id: 2,
        text: 'text',

    },
    {
        id: 3,
        text: 'text',
    },
    {
        id: 4,
        text: 'text',
    },
    {
        id: 5,
        text: 'text',

    },
    {
        id: 6,
        text: 'text',

    },
    {
        id: 7,
        text: 'text',
    },
    {
        id: 8,
        text: 'text',
    }
];
  return (
    <div>
        <span>CustomSlider</span>
        <Slider {...settings}>
            <Link >
                {/* <img className='right-banner__img' /> */}
                {slidesData02.map((slide) =>
                <div >
                    {slide.id}
                </div>
                )}
            </Link>
            </Slider>
    </div>
  )
}

export default Sanphamnoibat
